import { useEffect, useState } from "react";
import api from "../../services/api";
import "./Trainers.css";

const Trainers = () => {
  const [trainers, setTrainers] = useState([]);

  const loadTrainers = async () => {
    try {
      const res = await api.get("/api/trainers");
      setTrainers(res.data.data || []);
    } catch (err) {
      console.error("Trainer load error:", err);
    }
  };

  useEffect(() => {
    loadTrainers();
  }, []);

  return (
    <div className="fq-trainers-root">
      <h2>Our Trainers</h2>

      <div className="fq-trainer-grid">
        {trainers.map((t) => (
          <div className="fq-trainer-card" key={t._id}>
            <h4>{t.name}</h4>
            <p>{t.specialization}</p>
            <p>{t.experience} years</p>
          </div>
        ))}
      </div>

      {trainers.length === 0 && <p>No trainers found</p>}
    </div>
  );
};

export default Trainers;
